INSERT OR IGNORE INTO disease_interactions (id, med_id, trade_name, disease_name, interaction_text, severity, reference_text, source, created_at) VALUES (38901, 31987, 'Cholecalciferol', 'Arrhythmias, Cardiac', 'Vitamin D analogs function to increase serum calcium concentrations and can exacerbate arrhythmias, particularly in patients receiving cardiac glycosides.  Therapy with vitamin D analogs should be administered cautiously in patients with or predisposed to cardiac arrhythmias.  Clinical monitoring of serum electrolyte concentrations and cardiac function is recommended.', '3', '', 'DDInter', 0);
