INSERT OR IGNORE INTO disease_interactions (id, med_id, trade_name, disease_name, interaction_text, severity, reference_text, source, created_at) VALUES (38911, 66, 'Cholecalciferol', 'Water-Electrolyte Imbalance', 'Vitamin D analogs administered in the presence of hyperphosphatemia can result in precipitation of calcium-phosphate deposits within the vascular or  renal systems or other soft tissue calcifications.  A solubility product (Serum Calcium X Phosphate) should not exceed 70.  Serum electrolyte concentrations should be corrected prior to vitamin D analog therapy and monitored during therapy.', '3', '', 'DDInter', 0);
